import { useEffect, useState } from "react";
const Home = () => {
    useEffect(() => {
        const fetchWorkouts = async () => {
            const response = await fetch('/api/workout')
        }
        fetchWorkouts()
    }, [])
    return (
        <div className="home">
            <h3>Home </h3>
        </div>
    )
};
export default Home
